import React from 'react';
import styled from 'styled-components';

const ServicesContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Services = () => {
  return (
    <ServicesContainer>
      <h1>Our Services</h1>
      <p>Discover our comprehensive range of IT solutions.</p>
    </ServicesContainer>
  );
};

export default Services;
